import React from 'react'
import { Link } from 'react-router-dom';  

function DataInput({memos}) {
  return (
    <>
    <div className='bar'>
        <Link to='/memo'>
            <button className="w-btn w-btn-indigo" type="button">back</button>
        </Link>
        <button  className="w-btn w-btn-pink" type="button">Corret</button>
    </div>
    <div className='title'>
        {memos.map((memo,index)=>{
            <><div className='title_name'>{memos.memo}</div>
            <div className='content'>{memos.content}</div></>
        })}
        
    </div>
</>
  )
}

export default DataInput
